import React, {useState} from 'react';
import { Table, Form, Container, Button } from 'react-bootstrap';

const ProjectsPage = () => {
  const [filters, setFilters] = useState({ name: '', description: '', createdDate: '' , deadline: ''});
  const [sortBy, setSortBy] = useState('name');

  // Mock data for projects
  const projects = [
    { id: 1, name: 'Projekt 1', description: 'Opis projektu 1', createdDate: '2023-06-01', deadline: '2023-07-01' },
    { id: 2, name: 'b', description: 'Opis projektu 2', createdDate: '2023-06-05', deadline: '2023-07-15' },
  ];

  const filteredProjects = projects.filter((project) =>
    project.name.toLowerCase().includes(filters.name.toLowerCase()) &&
    project.description.toLowerCase().includes(filters.description.toLowerCase()) &&
    project.createdDate.toLowerCase().includes(filters.createdDate.toLowerCase()) &&
    project.deadline.toLowerCase().includes(filters.deadline.toLowerCase())
  );

  const sortedProjects = filteredProjects.sort((a, b) => {
    if (sortBy === 'name') {
      return a.name.localeCompare(b.name);
    } else if (sortBy === 'email') {
      return a.description.localeCompare(b.description);
    } else if (sortBy === 'createdDate') {
      return a.createdDate.localeCompare(b.createdDate);
    } else if (sortBy === 'deadline') {
      return a.deadline.localeCompare(b.deadline);
    }
    return 0;
  });

  const handleOpenProject = (projectId) => {
    // Implement your logic to open the user record based on the userId
    console.log(`Opening project record with ID: ${projectId}`);
  };

  const handleFilterChange = (e, key) => {
    setFilters((prevFilters) => ({
      ...prevFilters,
      [key]: e.target.value,
    }));
  };

  return (
    <Container className="text-center mt-4">
      <h2>Projects</h2>
      <div className="d-flex justify-content-between mb-3">
        <Form.Group controlId="sortBy" className="mr-2">
          <Form.Control
            as="select"
            value={sortBy}
            onChange={(e) => setSortBy(e.target.value)}
          >
            <option value="name">Name</option>
            <option value="description">Description</option>
            <option value="createdDate">Created Date</option>
            <option value="deadline">Deadline</option>
          </Form.Control>
        </Form.Group>
      </div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Created Date</th>
            <th>Deadline</th>
          </tr>
        </thead>
        <thead>
          <tr>
            <th>
              <Form.Control
                type="text"
                placeholder="Filter by Name"
                value={filters.name}
                onChange={(e) => handleFilterChange(e, 'name')}
              />
            </th>
            <th>
              <Form.Control
                type="text"
                placeholder="Filter by Description"
                value={filters.description}
                onChange={(e) => handleFilterChange(e, 'description')}
              />
            </th>
            <th>
              <Form.Control
                type="text"
                placeholder="Filter by Created Date"
                value={filters.createdDate}
                onChange={(e) => handleFilterChange(e, 'createdDate')}
              />
            </th>
            <th>
              <Form.Control
                type="text"
                placeholder="Filter by Deadline"
                value={filters.deadline}
                onChange={(e) => handleFilterChange(e, 'deadline')}
              />
            </th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {sortedProjects.map((project) => (
            <tr key={project.id}>
              <td>{project.name}</td>
              <td>{project.description}</td>
              <td>{project.createdDate}</td>
              <td>{project.deadline}</td>
              <td>
                <Button variant="primary" onClick={() => handleOpenProject(project.id)}>
                  Open
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default ProjectsPage;
